  const [apiChampions, getapiChampions] = useState()


  async function dbView(){
    return 'database'
  }

  async function apiView(){
    return 'api'
  }

  return (
    <div className='parent'>

      <div className='first'>
        <button style={{ width: '5vw' }} onClick={() => setView('db')}>Database</button>
